pragma solidity ^0.8.24;
contract CustomErrorExample {
    error Unauthorized(address caller);  // 自定义错误
    address public owner;
    constructor() {
        owner = msg.sender;
    }
    function restrictedFunction() public {
        if (msg.sender != owner) {
            revert Unauthorized(msg.sender);  // 使用自定义错误
        }
    }
}

